import React from "react";
import "./SideDrawer.css";
const sideDrawer = props => {
  let drawerClass = "side-drawer";
  if (props.show) {
    drawerClass = "side-drawer open";
  }
  return (
    <nav className="side-drawer">
      <ul>
        <li>
          <a href="/">Categories</a>
        </li>
      </ul>
    </nav>
  );
};
export default sideDrawer;
